import React, { useState, useEffect } from "react";
import { Box } from "@material-ui/core";
import Entries from "./Entries/Entries";
import { useHistory } from "react-router-dom";
import { ApiAuth } from "../api";
import { connect } from "react-redux";
import { createEntry, getEntries, updateEntry, deleteEntry } from "../modules/entries/entriesOperation";

const MainContent = ({ 
  user, 
  entries, 
  isLoadingUser, 
  isLoadingEntries,
  createEntry,
  getEntries,
  updateEntry,
  deleteEntry, 
}) => {
  return (
    <Box mb={5}>
      {ApiAuth.isLoggedIn() ? (
        <>{isLoadingUser ? <h1>Loading...</h1> :( 
        <Entries 
            {...{ user }} 
            {...{ entries}}
            {...{isLoadingEntries}}
            {...{createEntry}}
            {...{getEntries}}
            {...{updateEntry}}
            {...{deleteEntry}}

        />)}</>
      ) : (
        <div>Not Login</div>
      )}
    </Box>
  );
};

const mapStateToProps = (state: MainStateType) => {
  return {
    user: state.userReducer.user,
    entries: state.entriesReducer.items,
    isLoadingEntries: state.entriesReducer.isLoading,
    isLoadingUser: state.userReducer.isLoading,
  };
};

const mapDispatchToState = {
  createEntry,
  getEntries,
  updateEntry,
  deleteEntry,
};

export default connect(mapStateToProps, mapDispatchToState)(MainContent);
